import React from 'react'
import { Route } from 'react-router-dom'
import Search from './Search'

const SearchBar = () => {
    return (
        <div className="searchbar">
            <Route render={({ history }) => <Search history={history} />} />
        </div>
    )
}

export default SearchBar
